export async function getFoods({ order = "createdAt", cursor = "", limit }) {
  const query = cursor
    ? `order=${order}&cursor=${cursor}&limit=${limit}`
    : `order=${order}&limit=${limit}`;

  const response = await fetch(`https://learn.codeit.kr/9188/foods?${query}`);
  const body = await response.json();
  return body;
}
